import Img from "react-image";

const Help = () => {

  const [input_content, setInput_content] = useState('Search')


  // start objects RenderingArrayOfObjects
    function RenderingArrayOfObjects() {
      const data = [
        {
          id: 1,
          name: "How it works",
          src: "assets/img/help/icon01.png"
        },

        {
          id: 2,
          name: "Faq",
          src: "assets/img/help/Shape.png"
        },
        {
          id: 3,
          name: "My Account",
          src: "assets/img/help/contact01.png"
        }
      ];

      const listItems = data.map(
        (element) => {
            return(

              <ul className="list-">
              <li className="">
                  <div className="support-image">
                  <img src={element.src} alt="can't show image" />
                    </div>
                    <div className="circle-content">
                    <p className="">{element.name}</p>
                  </div>
              </li>
              </ul>

            )
        }
      )
      return(
        <div>
        {listItems}
    </div>
      )
    }
 // start objects RenderingArrayOfObjects


// start Accordion section 
 const Accordion = ({ title, children }) => {
  const [isOpen, setOpen] = React.useState(false);
  return (
    <div className="accordion-wrapper">

      <div
        className={`accordion-title ${isOpen ? "open" : ""}`}
        onClick={() => setOpen(!isOpen)}
        >
        {title}
      </div>
      <div className={`accordion-item ${!isOpen ? "collapsed" : ""}`}>
        <div className="accordion-content">{children}</div>
      </div>
    </div>
  );
};
// End Accordion section 


function AccordionArrayOfObjects() {
  const dataarray = [
    {
      id: 1,
      title:"How it works",
      content:"Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.",
    },
    {
      id: 2,
      title:"How it works",
      content:"Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.",
    }

  ];
  const accordionItems = dataarray.map((value) => {
    return(
      <div className="accordion_content" key={value.id}>
        <div className="wrapper">
          <Accordion title={value.title}>
            {value.content}
          </Accordion>

        </div>    
      </div>

    )

  })




}



  return (
    <>

    {/* <!-- ======= help Remitassure Support-Section  start======= --> */}
    <section className="why-us section-bgba help_banner" data-aos="fade-up" date-aos-delay="200">
      <div className="container">

        <div className="support_image">
            <img src="assets/img/help/suport.png" alt="support_images" />
        </div>

